import React from 'react'
import { BagPic, PopupContent, PopupDiv } from './StyleHomePage'


export default function HomePageEmptyBag() {
  return (
    <PopupDiv>
        <PopupContent>
          <BagPic src='./assets/BagLogo.svg'/>
          <p> Your Bag is Empty </p>
        </PopupContent>
    </PopupDiv>
  )
}
